        {"ClassName":"core.Turma","NameSpace":"SAMPLES","SourceText":"Class core.Turma Extends (%Persistent, %Populate, %XML.Adaptor)\r\n{\r\n\r\nProperty Data As %Date(FORMAT = 4);\r\n\r\nProperty Status As %String(DISPLAYLIST = \",Aberta,Fechada\", VALUELIST = \",A,F\");\r\n\r\nProperty Instrutor As core.Instrutor;\r\n\r\nProperty Curso As core.Curso;\r\n\r\nRelationship Alunos As core.Participante [ Cardinality = children, Inverse = Turma ];\r\n\r\nMethod SalarioInstrutor() As %Currency\r\n{\r\n\tQ (..Alunos.Count() * ..Curso.Preco) * .1\r\n}\r\n\r\nStorage Default\r\n{\r\n<Data name=\"TurmaDefaultData\">\r\n<Value name=\"1\">\r\n<Value>%%CLASSNAME<\/Value>\r\n<\/Value>\r\n<Value name=\"2\">\r\n<Value>Data<\/Value>\r\n<\/Value>\r\n<Value name=\"3\">\r\n<Value>Status<\/Value>\r\n<\/Value>\r\n<Value name=\"4\">\r\n<Value>Istrutor<\/Value>\r\n<\/Value>\r\n<Value name=\"5\">\r\n<Value>Curso<\/Value>\r\n<\/Value>\r\n<Value name=\"6\">\r\n<Value>Instrutor<\/Value>\r\n<\/Value>\r\n<\/Data>\r\n<DataLocation>^core.TurmaD<\/DataLocation>\r\n<DefaultData>TurmaDefaultData<\/DefaultData>\r\n<ExtentSize>3<\/ExtentSize>\r\n<IdLocation>^core.TurmaD<\/IdLocation>\r\n<IndexLocation>^core.TurmaI<\/IndexLocation>\r\n<Property name=\"%%CLASSNAME\">\r\n<Selectivity>100.0000%<\/Selectivity>\r\n<\/Property>\r\n<Property name=\"Curso\">\r\n<Selectivity>100.0000%<\/Selectivity>\r\n<\/Property>\r\n<Property name=\"Data\">\r\n<Selectivity>33.3333%<\/Selectivity>\r\n<\/Property>\r\n<Property name=\"Instrutor\">\r\n<Selectivity>100.0000%<\/Selectivity>\r\n<\/Property>\r\n<Property name=\"Istrutor\">\r\n<Selectivity>100.0000%<\/Selectivity>\r\n<\/Property>\r\n<Property name=\"Status\">\r\n<Selectivity>50.0000%<\/Selectivity>\r\n<\/Property>\r\n<SQLMap name=\"IDKEY\">\r\n<BlockCount>-4<\/BlockCount>\r\n<\/SQLMap>\r\n<StreamLocation>^core.TurmaS<\/StreamLocation>\r\n<Type>%Library.CacheStorage<\/Type>\r\n}\r\n\r\n}\r\n\r\n"}
